import { System, Trace } from '@envyjs/webui';

export default class CatFactsSystem implements System<null> {
  name = 'Cat Facts API';

  isMatch(trace: Trace) {
    return trace.http?.host === 'cat-fact.herokuapp.com';
  }

  getIconUri() {
    return 'data:image/svg+xml;base64,';
  }

  getTraceRowData() {
    return {
      data: 'Cat fact',
    };
  }
}
